import Link from 'next/link';

const Navbar = () =>  (

    <div>
        <ul>
            <li></li>
            <li></li>

        </ul>
        <Link href="/">Home</Link>
        <br/>
        <Link href="about">About Us</Link>

    </div>

);


export default Navbar;
